import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import {
  Code2, Braces, Palette, FileCode, Server, FileType, GitBranch, Globe,
  Database, TestTube, Shield, Rocket, Link2, Binary
} from 'lucide-react';

// Function to render the list of topics
const renderTopics = (topics, pathname) => {
  return topics.map((topic, index) => {
    const Icon = topic.icon;
    const isActive = pathname === topic.route;
    
    return (
      <li key={index}>
        <Link 
          to={topic.route} 
          className={`nav-item ${isActive ? 'active' : ''}`}
        >
          <Icon size={18} />
          <span>{topic.name}</span>
        </Link>
      </li>
    );
  });
};

function Nav() {
  const location = useLocation();

  const topics = [
    { name: 'React', icon: Code2, route: '/react-info' },
    { name: 'JavaScript', icon: Braces, route: '/javascript-info' },
    { name: 'CSS', icon: Palette, route: '/css-Info' },
    { name: 'HTML', icon: FileCode, route: '/html' },
    { name: 'Node.js', icon: Server, route: '/nodejs-info' },
    { name: 'TypeScript', icon: FileType, route: '/typescript' },
    { name: 'Git&GitHub', icon: GitBranch, route: '/git' },
    { name: 'WebAPIs', icon: Globe, route: '/webapi' },
    { name: 'Testing', icon: TestTube, route: '/testing' },
    { name: 'Security', icon: Shield, route: '/security' },
    { name: 'Deployment', icon: Rocket, route: '/deployment' },
    { name: 'REST APIs', icon: Link2, route: '/restapi' },
    { name: 'Data Structures', icon: Binary, route: '/data-structures' },
    { name: 'Algorithms', icon: Binary, route: '/algorithms' },
    { name: 'Databases', icon: Database, route: '/databases' }
  ];

  return (
    <>
      {/* CRITICAL FIX: CSS is embedded directly here to resolve the 
        "Could not resolve './nav.css'" import error. 
      */}
      <style>{`
        /* Reset & Base */
        * {
          margin: 0;
          padding: 0;
          box-sizing: border-box;
          font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
          color: #e0e0e0;
        }

        /* ---------------------------------- */
        /* CONTAINER (Sticky Header) */
        /* ---------------------------------- */

        .nav-container {
          width: 100%;
          background: #000;
          padding: 10px 15px;
          display: flex;
          justify-content: space-between; 
          align-items: center;
          border-bottom: 1px dashed #10b981;
          position: sticky;
          top: 0;
          z-index: 999;
        }


        /* Logo */
        .nav-logo {
          font-size: 22px;
          font-weight: 700;
          color: #10b981;
          padding-right: 15px; 
        }

        /* ---------------------------------- */
        /* DESKTOP MENU (Standard Row) */
        /* ---------------------------------- */

        .nav-scroll-wrapper {
            /* Full visibility on desktop */
            width: auto;
            overflow: visible;
        }

        .nav-menu {
          display: flex; /* Ensures items stay in a row */
          list-style: none;
          gap: 8px; 
          padding: 0;
          margin: 0;
          white-space: nowrap; /* Prevent items from wrapping to the next line */
        }

        /* Menu Item */
        .nav-item {
          display: grid;
          grid-template-columns: auto 1fr;
          align-items: center;
          border: 1px dashed #10b981;
          border-radius: 4px;
          padding: 8px 12px;
          color: #e0e0e0;
          text-decoration: none;
          font-size: 14px;
          gap: 8px;
          transition: all 0.3s ease;
          cursor: pointer;
          flex-shrink: 0; /* Important: Prevents items from shrinking on scroll view */
        }

        .nav-item:hover {
          background-color: #10b981; 
          color: #000000;
          border-color: #10b981;
        }

        /* Active menu item */
        .nav-item.active {
          background-color: #4ade80; 
          color: #000000; 
          font-weight: 600;
          border-color: #4ade80;
        }


        /* ---------------------------------- */
        /* MOBILE STYLES (User-Scrollable Row) */
        /* ---------------------------------- */

        @media (max-width: 768px) {
          .nav-container {
            /* Logo top-left, Menu below, filling the width */
            flex-direction: column;
            align-items: flex-start; 
            gap: 5px;
            padding: 10px 0 5px 0; 
          }
          
          .nav-logo {
              padding: 0 15px 5px 15px; 
              width: 100%;
              box-sizing: border-box;
              border-bottom: 1px dashed #10b981;
          }
          
          /* Scroll Wrapper (CRITICAL for user-controlled scroll) */
          .nav-scroll-wrapper {
            overflow-x: auto; /* Enables horizontal scroll bar */
            width: 100%;
            display: block;
            position: relative;
            padding: 5px 15px; /* Padding for scrollable area, keeps scrollbar inside */
            scroll-behavior: smooth;
          }
          
          /* Hide scrollbar on supported browsers for a cleaner look */
          .nav-scroll-wrapper::-webkit-scrollbar {
            display: none;
          }
          .nav-scroll-wrapper {
            -ms-overflow-style: none; /* IE and Edge */
            scrollbar-width: none; /* Firefox */
          }

          /* Ensure the ul list flows horizontally inside the wrapper */
          .nav-menu {
            display: flex; 
            gap: 8px;
          }

          .nav-item {
            flex-shrink: 0; /* Ensures items don't compress */
            margin: 2px 0; 
          }
        }
      `}</style>

      <div className="nav-container">
        <div className="nav-logo">Dev Topics</div>

        {/* This container enables manual horizontal scrolling on mobile */}
        <div className="nav-scroll-wrapper">
          <ul className="nav-menu">
            {renderTopics(topics, location.pathname)}
          </ul>
        </div>
      </div>
    </>
  );
}

export default Nav;
